@Component({
  selector: 'app-product-list',
  templateUrl: './product-list.component.html',
  styleUrls: ['./product-list.component.css']
})
export class ProductListComponent {
  products = [
    { id: 1, name: 'Product A', description: 'Description A', brand: 'Brand A', gender: 'Unisex', category: 'Category A', size: 'M', color: ['Red', 'Blue'], price: 100, inStock: true, itemsLeft: 10, imageUrl: 'path/to/imageA', slug: 'product-a' },
